import React from "react";
import { Container, Box } from "@chakra-ui/react";

const Homepage = () => {
  return (
    <div>
      <Container maxW="xl" centerContent>
        <Box 
          d="flex"
          justifyContent="center"
          p={3}
          bg={"white"}
          w="100%"
          m="40px 0 15px 0">
          <Text>Talk-A-Tive</Text>
        </Box>
        Box
      </Container>
    </div>
  );
};

export default Homepage;
